static void _hotpy_print_string_list(R_list list, R_AST_Visitor visitor) {
    FILE* out = (FILE*)visitor->p;
    intptr_t indent = visitor->i;
    int i, len;
    GVMT_OBJECT(str)* object;
    if (list == NULL) {
        fprintf(out, "NULL\n");
        return;
    }
    len = LIST_SIZE(list);
    if (len == 0) {
        fprintf(out, "[]\n");
    } else {
        fprintf(out, "[\n");
        for (i = 0; i < len; i++) {
            object = (GVMT_OBJECT(str)*)ITEM(list->array, i);
            _hotpy_print_spaces(out, indent+1);
            _hotpy_print_string(object, visitor);
        }
        _hotpy_print_spaces(out, indent);
        fprintf(out, "]\n");
    }
}

void print_visit_Module(R_AST_Module object, R_AST_Visitor visitor) {
    FILE* out = (FILE*)visitor->p;
    intptr_t indent = visitor->i;
    if (object == NULL) {
        fprintf(out, "NULL\n");
        return;
    }
    TYPE_ASSERT(object, AST_Module);
    _hotpy_print_spaces(out, indent+1);
    fprintf(out, "Module:\n");
    visitor->i = indent+1;
    _hotpy_print_spaces(out, indent+1);
    fprintf(out, "%s = ", "body");
    _hotpy_print_stmt_list(object->body, visitor);
    visitor->i = indent;
}

