static void _hotpy_print_stmt_list(R_list list, R_AST_Visitor visitor) {
    FILE* out = (FILE*)visitor->p;
    intptr_t indent = visitor->i;
    int i, len;
    GVMT_OBJECT(AST_stmt)* object;
    if (list == NULL) {
        fprintf(out, "NULL\n");
        return;
    }
    len = LIST_SIZE(list);
    if (len == 0) {
        fprintf(out, "[]\n");
    } else {
        fprintf(out, "[\n");
        for (i = 0; i < len; i++) {
            object = (GVMT_OBJECT(AST_stmt)*)ITEM(list->array, i);
            _hotpy_print_spaces(out, indent+1);
            hotpy_visit_stmt(object, visitor);
        }
        _hotpy_print_spaces(out, indent);
        fprintf(out, "]\n");
    }
}

